    --background-color1: #6a17d1;
    --background-color2: #170224;
    --loader-color1: #7aec4d;
    --loader-color2: #47c61b;
    --inset-shadow-color: #f2f88b;
    --border-shadow-color: #6d5dff;
  }

  .loader_c {
    position: absolute;
    top: 0;
    left: 0;
    width: 100vw;
    height: 100vh;
    background: #4C61C8;
    z-index: 20;
  }

  .loader::before,
  .loader::after {
    content: "";
    display: block;
    position: absolute;
  }

  .loader::before {
    top: 0;
  }

  .loader::after {
    bottom: 0;
  }

  @keyframes blink {
    0% {
      opacity: 1;
    }
    99% {
      opacity: 0;
    }
    100% {
      opacity: 0;
    }
  }

  .loader_c.custom {
    /* background: radial-gradient(circle, var(--background-color1) 0%, var(--background-color2) 80%); */
    /* background: radial-gradient(circle, #c8e7ff 0%, #00a1ff 115%); */
    background: radial-gradient(circle, #ffb768 0%, #72420e 115%);
    background-size: 100% 100%;
  }

  .loader {
    background: var(--logo-image) top center/auto 100% no-repeat;
    background-size: contain;
    position: absolute;
    left: 50%;
    transform: translate(-50%, -50%);
    max-height: 80vh;
    width: 50%;
    /*filter: drop-shadow(0px 5px 2px rgb(0 0 0 / 0.6));*/
  }

  .loader.custom:before,
  .loader.custom::after {
    border-radius: 40px;
    width: 100%;
    margin: 0 auto;
    background-size: 100% 100%;
    background-repeat: repeat-x;
    z-index: 22;
  }

  .loader.custom::after {
    width: 100%;
    background: linear-gradient(0deg, #bd9b5b 0%, #f0d6a4 50%, #d3a652 100%);
    /*box-shadow: 0 0 8px 3px #fdffd4;*/
    top: 140.5%;
  }

  .loader.custom::before {
    width: 102%;
    background: #a16019;
    box-shadow: 1px 2px 4px 1px #452a16 inset;
    top: 140%;
  }

  .l-text {
    width: 100%;
    text-align: center;
    position: absolute;
    top: 120%;
    color: #fff;
    letter-spacing: 0.5px;
    font-size: 5vw;
    font-weight: 600;
    font-family: "Trebuchet MS", "Lucida Sans Unicode", "Lucida Grande",
      "Lucida Sans", Arial, sans-serif;
    transform: scaleY(0.85);
    display: flex;
    justify-content: center;
  }

  .dots {
    letter-spacing: 0;
    margin-left: 3px;
  }

  .dots > span {
    opacity: 0;
    display: inline-block;
    background: #fff;
    border-radius: 50%;
    animation: blink 1.5s infinite backwards;
    animation-fill-mode: both;
  }

  .dots > span:nth-child(2) {
    animation-delay: 0.2s;
  }

  .dots > span:nth-child(3) {
    animation-delay: 0.4s;
  }

  @media (orientation: portrait) {
    @keyframes loading {
      0% {
        width: 5%;
      }
      100% {
        width: 130%;
      }
    }
    .loader {
      height: 20%;
      top: 45%;
    }

    .loader.custom:before {
      height: 17%;
      width: 132%;
      margin-left: -16.3%;
    }

    .loader.custom::after {
      height: 15%;
      width: 0;
      margin-left: -15%;
      animation: loading 1.5s linear forwards;
    }

    .l-text {
      font-size: 5vw;
    }

    .dots > span {
      width: 1vw;
      height: 0.55vh;
    }
  }

  @media (orientation: landscape) {
    @keyframes loading {
      0% {
        width: 5%;
      }
      100% {
        width: 100%;
      }
    }
    .loader {
      height: 25%;
      top: 40%;
    }

    .loader.custom:before {
      height: 16%;
      width: 101%;
      margin-left: -0.6%;
    }

    .loader.custom::after {
      height: 16%;
      width: 0;
      margin-left: 0;
      animation: loading 1.5s linear forwards;
    }

    .l-text {
